  state = {
    "item": {
      "resources": []
    }
  }

  componentDidMount() {
    console.log(this.props.id);

    axios.get("http://dkan.local/api/v1/dataset/" + this.props.id)
      .then(res => {

        const item = res.data;

        this.setState({ "item": item });
      });
  }

